script: |
  super -f text -I q7381.spq | sort > q7381.out

inputs:
  - name: q7381.spq
    data: |
      SELECT 29 * col2 - + col0 * col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 * + ( col1 ) - col1 NOT IN ( - + col1, - col0, + 97 * col1, + col2, - col2 + col1, - ( + col2 ) );
  - name: tab2

outputs:
  - name: q7381.out
    data: |
